import React, {useState} from "react";
import ReactDOM from "react-dom";
import { Link } from "react-router-dom";
import {Button} from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import '../assets/styles/all.css';
import '../assets/styles/test.css';

const Test = (props) => {
    const [posts, setPosts] = useState([]);
    const [currentPage, setCurrentPage] = useState(1);
    const [postsPerPage, setPostPerPage] = useState(10);

    return (
        <>
            <div>
                <article className="question">
                    {tests.map((test) => {
                        return(
                            <article className="question_area mt-5 mb-5">
                                <h1 id="questionNum" className="text-center mt-3">{test.questionNum}</h1>
                                <h5 id="title" className="question_content text-center mt-3">{test.title}</h5>
                                <input id="type" type="hidden" value="EI"/>
                                <Button onClick={props.onClick} id="A" className="btn-answer btn btn-primary pt-5 pb-5 mt-4">{test.A}</Button>
                                <Button onClick={props.onClick} id="B" className="btn-answer btn btn-primary pt-5 pb-5 mt-4">{test.B}</Button>
                            </article>
                        ) 
                    })}
                </article>
            </div>
        </>
    )
}

export default Test;
